import './index.scss';
export const RightComponent = () => {
    return (
        <div className="right-container">
            <div className="header">
                <div><span>My</span></div>>
                <button className="add-folder">
                    <span className="material-icons">add</span>
                    <span>New Folder</span>
                </button>
            </div>
        </div>
    )
}
